// App.js
import React, { useState } from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import ContactUs from './ContactUs';
import PopularDestinations from './PopularDestinations';
import PopularEvents from './PopularEvents';
import TravelBuddy from './TravelBuddy'; 
import Profile from './Profile'; // Import the Profile component
import About from './About'; // Import the About component
import TravelPackage from './TravelPackage'; // Import TravelPackage component
import BookATrip from './BookATrip'; // Import BookATrip component
import PackageDetails from './PackageDetails';
import './App.css';
import logoImage from './images/logo-modified.png';

function App() {
  const [showProfile, setShowProfile] = useState(false);

  const toggleProfile = () => {
    setShowProfile(!showProfile);
  };

  const closeProfile = () => {
    setShowProfile(false);
  };

  return (
    <Router> {/* Only one Router instance here */}
      <div className="App">
        <header>
          <div className="logo-container">
            <Link to="/about" onClick={closeProfile}>
              <img src={logoImage} alt="Logo" className="header-logo" />
            </Link>
            <div className="logo" onClick={closeProfile}>
              <div>TRAVEL</div>
              <div>BUDDY</div>
            </div>
          </div>
          <nav>
            <Link to="/" onClick={closeProfile}>Home</Link>
            <Link to="/travelbuddy" onClick={closeProfile}>Travel Buddy</Link>
            <Link to="/destinations" onClick={closeProfile}>Popular Destinations</Link>
            <Link to="/travelpackage" onClick={closeProfile}>Travel Package</Link> {/* Link to Travel Package */}
            <Link to="/events" onClick={closeProfile}>Popular Events</Link>
            <Link to="/bookatrip" onClick={closeProfile}>Book a Trip</Link> {/* Link to Book a Trip */}
            <Link to="/contact" onClick={closeProfile}>Contact Us</Link>
          </nav>
          <div className="profile-icon" onClick={toggleProfile}>ðŸ‘¤</div>
        </header>

        {showProfile && <Profile />} {/* Conditionally render Profile component */}

        <Routes>
          <Route path="/" element={<TravelBuddy />} />
          <Route path="/travelbuddy" element={<TravelBuddy />} />
          <Route path="/about" element={<About />} />
          <Route path="/contact" element={<ContactUs />} />
          <Route path="/destinations" element={<PopularDestinations />} />
          <Route path="/events" element={<PopularEvents />} />
          <Route path="/travelpackage" element={<TravelPackage />} /> {/* Route for Travel Package */}
          <Route path="/bookatrip" element={<BookATrip />} /> {/* Route for Book a Trip */}

        </Routes>
      </div>
    </Router>
  );
}

export default App;
